import React from 'react';
import { motion } from 'framer-motion';

const Index2 = () => {
  return (
    <div className="bg-black min-h-screen text-white relative overflow-hidden">
      {/* Animated background */}
      <motion.div 
        className="absolute inset-0 z-0"
        animate={{
          backgroundPosition: ['0% 0%', '100% 100%'],
        }}
        transition={{
          repeat: Infinity,
          repeatType: 'reverse',
          duration: 20,
        }}
        style={{
          backgroundImage: 'url("https://path-to-your-wave-background.svg")',
          backgroundSize: '200% 200%',
        }}
      />

      {/* Content */}
      <div className="relative z-10 container mx-auto px-6 py-12 text-center">
        <h1 className="text-4xl md:text-6xl font-bold mb-6">
          Empowering the Future of<br />
          Freelancing with Blockchain
        </h1>

        <button className="bg-transparent border-2 border-purple-500 text-purple-500 px-8 py-3 rounded-full text-lg font-semibold hover:bg-purple-500 hover:text-white transition duration-300">
          Partner with Us
        </button>
      </div>

      {/* Abstract shapes */}
      <motion.div 
        className="absolute bottom-0 right-0 w-1/2 h-1/2 opacity-50"
        animate={{
          rotate: [0, 360],
        }}
        transition={{
          repeat: Infinity,
          duration: 20,
        }}
      >
        <svg viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
          <path fill="#8B5CF6" d="M44.7,-76.4C58.8,-69.2,71.8,-59.1,79.6,-45.8C87.4,-32.5,90,-16.3,89.1,-0.5C88.2,15.3,83.8,30.6,75.6,43.9C67.4,57.1,55.4,68.3,41.6,76.3C27.9,84.3,13.9,89.1,-0.4,89.8C-14.7,90.5,-29.4,87,-42.3,79.7C-55.2,72.4,-66.3,61.2,-74.7,47.7C-83.1,34.2,-88.8,17.1,-89.6,-0.5C-90.5,-18.1,-86.5,-36.2,-77.1,-50.5C-67.7,-64.8,-52.9,-75.3,-37.8,-81.5C-22.7,-87.7,-11.3,-89.6,2.1,-93.1C15.6,-96.6,31.2,-101.7,44.7,-76.4Z" transform="translate(100 100)" />
        </svg>
      </motion.div>
    </div>
  );
};

export default Index2;
